import "./Hero.css";

import cover from "../../../../images/assets/home/desktop/hero.svg";

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero__cover">
        <div className="hero__container">
          <div className="hero__info">
            <p className="hero__subtitle">NEW PRODUCT</p>
            <h1 className="hero__title">XX99 Mark II HeadphoneS</h1>
            <p className="hero__text">
              Experience natural, lifelike audio and exceptional build quality made for the passionate music enthusiast.
            </p>
            <button className="hero__button">See Product</button>
            <img className="hero__img" src={cover} alt="hero cover"></img>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Hero;
